import * as React from 'react';
import PropTypes from 'prop-types';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import { createTheme } from '@mui/material/styles';
import Profile from '@mui/icons-material/AccountCircle';
import Search from '@mui/icons-material/Search';
import Home from '@mui/icons-material/Home';
import Movies from '@mui/icons-material/Movie';
import { AppProvider } from '@toolpad/core/AppProvider';
import { DashboardLayout } from '@toolpad/core/DashboardLayout';
import Signin from './signin';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogTitle from '@mui/material/DialogTitle';

const NAVIGATION = [
  // {
  //   kind: 'header',
  //   title: 'Main items',
  // },
  {
    segment: 'dashboard',
    title: 'My Space',
    path: '/dashboard',
    icon: <Profile />,
    component: <Signin />,
  },
  {
    segment: 'orders',
    title: 'Search',
    icon: <Search />,
  },
//   {
//     kind: 'divider',
//   },
//   {
//     kind: 'header',
//     title: 'Analytics',
//   },
  {
    segment: 'reports',
    title: 'Home',
    icon: <Home />,
    // children: [
    //   {
    //     segment: 'sales',
    //     title: 'Sales',
    //     icon: <DescriptionIcon />,
    //   },
    //   {
    //     segment: 'traffic',
    //     title: 'Traffic',
    //     icon: <DescriptionIcon />,
    //   },
    // ],
  },
  {
    segment: 'integrations',
    title: 'Movies',
    icon: <Movies />,
  },
];

const demoTheme = createTheme({
  cssVariables: {
    colorSchemeSelector: 'data-toolpad-color-scheme',
  },
  colorSchemes: { light: true, dark: true },
  breakpoints: {
    values: {
      xs: 0,
      sm: 600,
      md: 600,
      lg: 1200,
      xl: 1536,
    },
  },
});

function DemoPageContent({ pathname }) {
  // return (
  //   <Box
  //     sx={{
  //       py: 4,
  //       display: 'flex',
  //       flexDirection: 'column',
  //       alignItems: 'center',
  //       textAlign: 'center',
  //     }}
  //   >
  //     <Typography>Dashboard content for {pathname}</Typography>
  //   </Box>
  // );
  switch (pathname) {
    case '/dashboard':
      return <Signin />;
    case '/search':
      return <Box><Typography>Search Page</Typography></Box>;
    case '/home':
      return <Box><Typography>Home Page</Typography></Box>;
    case '/movies':
      return <Box><Typography>Movies Page</Typography></Box>;
    default:
      return <Box><Typography>404: Page Not Found</Typography></Box>;
  }
}

DemoPageContent.propTypes = {
  pathname: PropTypes.string.isRequired,
};

function DashboardLayoutBasic(props) {
  const { window } = props;

  const [open, setOpen] = React.useState(false);

  const [pathname, setPathname] = React.useState('/dashboard');

  const router = React.useMemo(() => {
    return {
      pathname,
      searchParams: new URLSearchParams(),
      navigate: (path) => setPathname(String(path)),
    };
  }, [pathname]);


  // Toggle popup
  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };


  // Remove this const when copying and pasting into your project.
  const demoWindow = window !== undefined ? window() : undefined;

  return (
    // preview-start
    <AppProvider
      navigation={NAVIGATION}
      router={router}
      theme={demoTheme}
      window={demoWindow}
    >

     {/* This is the pre-signin blue background section with a Login button */}
     <Box
        sx={{
          backgroundColor: 'blue',
          minHeight: '100vh',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          color: 'white',
          textAlign: 'center',
        }}
      >
        <Box>
          <Typography variant="h4" gutterBottom>
            Welcome! Please Login
          </Typography>
          <Button variant="contained" color="primary" onClick={handleClickOpen}>
            Login
          </Button>
        </Box>
      </Box>

      {/* Dialog for signin page */}
      <Dialog open={open} onClose={handleClose} maxWidth="xs" fullWidth>
        <DialogTitle>Sign In</DialogTitle>
        <DialogContent>
          <Signin />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Close
          </Button>
        </DialogActions>
      </Dialog>
    </AppProvider>

    //  {/* <DashboardLayout>
    //     <DemoPageContent pathname={pathname} />
    //   </DashboardLayout> */}
    // </AppProvider>
    // // preview-end */}
  );
}

DashboardLayoutBasic.propTypes = {
  /**
   * Injected by the documentation to work in an iframe.
   * Remove this when copying and pasting into your project.
   */
  window: PropTypes.func,
};

export default DashboardLayoutBasic;
